import React from 'react'
import Cake1 from "../assets/Cake1.jpg";
function Home() {
  return (
    <div className='bg-orange-200 max-h-full'>
        <img src={Cake1} alt="cake image" className='rounded-3xl w-[500px] h-[500px]'/>
        <div>
            <h1>Luxury Cakes for Baddies</h1>
        </div>
    </div>
  )
}

export default Home
